INSERT INTO review VALUES(971, 176, 5, 'I love Tea...  Tata gold tea is one of the best product of Tata...  This it is very useful for daily use...I got this product from Amazon and got a recently manufactured product... The product is a genuine product...There are other variety of Tea available in the market but among those Tata gold tea is is the best tea according to me for daily use...I got the product at 15% discounted price, as I bought the product during Super Value Days.The manufacturing date of product was just 2 and half months ago from date when I received the product in hand. Hence it is recently manufactured product. Also the product have a very good shelf life.Amazon delivered the product in very good condition and packaging of the product was just awesome. No damage. Amazing...The Amazon pantry box are very hard and during packaging they insert air filled sealed packets, so that the items dont move and pressure is absorbed by the air filled packets.Delivery of my order was just the next day morning. The delivery man took the package inside of my house, as it was heavy and kept the pantry box over a table, as I told him. I behavior of the delivery man was good.I am highly satisfied with the product and I recommend you to buy the product without any fear and hesitation. Believe me you will be satisfied after receiving the product and using it.');
