INSERT INTO review VALUES(975, 119, 3, 'Awesome packaging done by amazon !!Product review:Pros: 1.Easy to Carry  2.Touch screen is absolutely smooth.  3.Working mini safe with a primitive touch screen run by a 9 volt battery..well that is awesome.  4.Developers and Designers have done a great job in creating a sleek and stylish safe.Cons:  1.Although the safe looks great..not much space to place enough valuables.If u place a mobile,wallet and a wristwatch..space is done for.  2.Inner layer of the safe is made by a grossest material.Its so rough that it can scratch the back side of your iphone if havent placed carefully.  3.Wiring for this safe can be done better.  4.Default battery provided to you will be a GP 9 volt alkaline battery,Mine was pretty much messySo to sum this up,a fine product for occasional use (routine if you are thrifty enough to spend bucks on batteries) with a stylish look 🏻');
