INSERT INTO review VALUES(1067, 152, 2, 'Hello everyone, Please buy this product only if you are looking for "Moisturizer" .This works as a great moisturizer and it does the job what it claims for but not 100%.Iam writing this review after 1 month of usage and realised that this is a product where 30ml  isnt available in original website of "Mamaearth , I  figured out only after purchasing 50 ml from original website of Mamaearth.Ingredients: If you compare the ingredients of 30ml and 50ml : 30ml contains all the chemicals and 50ml consists of all the essential oils which is great.Scent: 30ml bottle has great smell coz all the chemicals are added.50ml bottle has the smell of essential oils which most of them might not like it( Hardly any chemical is added)This I figured out after using the 30ml which I purchased from Amazon and I used it exactly for 1 month and bottle got over, then I was looking to buy another one and I went to Mamaearth original site and figured out this .I would recommend you to compare the ingredients before you buy this from Amazon');
