INSERT INTO review VALUES(1352, 3, 3, 'Patanjali Ghee is not that pure or real Ghee smell like expected.Its like ordinary and looks like refined oil mixed with pure ghee.In comparison Nandini ghee or Jharana Ghee is better than this.Next time will try Amul or some organic brand or make at Home if I need pure ghee.I know how does the pure ghee smells like. Conclusion - Patanjalii is not upto the mark...');
