INSERT INTO review VALUES(1922, 422, 4, 'These champs are better considering they are way to different from the Odonil fresheners we have been using for ages (its basic law of diminishing returns) Ill encourage you to try them for their fragrance, and they are apt for any room in your apartment. When newly opened the fragrance is too strong that i would kick you in the face with it, but it dissolves when you give it a couple of days.Another good part about this is the concept of hanging it, I usually do in the fall ceiling of my washrooms, and it works pretty well.Word of caution: Dont expect it to last a month, because mine never have. Maximum 20 to 22 days, and then youll want to replace it with a new one, but if you grab it on a deal on Amazon Pantry, its quite economical');
