INSERT INTO review VALUES(1925, 496, 5, 'This is very handy and useful. I keep it inside my wardrobe and store my wallet, car key and other loose currency and change in it when I come back from office. So no more  carelessly placed wallet risking small stealing by maid. As I got the wardrobe made recently, I got a specially designed compartment to keep this safe. It works flawlessly and is very easy to operate.  If I want to lock all the other wardrobes at home while going out somewhere, I keep the keys inside this.  no need to carry so many keys with me. One needs to know the purpose of this safe and the way to use it.');
