INSERT INTO review VALUES(1991, 270, 1, 'Earlier" society "tea powder is Good in quality and flavour but after "society "comes in society its quality degraded and amlagmation of dust in "chaipatti " dettered its qiality.we hope for best from "society "to best for society');
INSERT INTO continutvanzare VALUES(1991, 379, 287832, 10);
INSERT INTO review VALUES(1991, 379, 5, 'Tata Tea Agni is good but the quality of this tea have changed a lot previously there was some leaves but nowadays Tata Tea Agni contains only powder tea or dust tea, it gives good liquor but not so much flavour.If you want good liquor along with flavour then you must go for Tata Gold tea that is a good tea. I bought Tata Tea Agni from Amazon at a very low price compared to the MRP and the packaging of the product was really awesome and it was delivered to my home address Durgapur Rana Pratap Road West Bengal within 5 days of ordering.If you want to buy good quality tea with good flavour then you should buy Tata Gold tea, Taj Mahal tea or Darjeeling tea.');
