INSERT INTO review VALUES(1995, 101, 5, 'The product is good. The only caveat (as I have noticed so far) is to be careful with the alarm. Dont keep stuff on it after switching the alarm on. Second, I think the alarm tone itself should change. It needs to be ALARMING. The volume needs to be a bit on the higher side as well. One can easily muffle the sound with a blanket type of fabric and make a getaway. That said, it is quite a sleek gadget. Definitely worth more than what one would be paying for. Its a bit heavy, but I guess that needs to be part of the "package" so to speak.');
