INSERT INTO review VALUES(2122, 94, 4, 'Reviewing CTC tea can be tricky: everyone has their own preferences. Flavour profiles that one has become accustomed to often determines how one reacts to a new tea.For the purpose of making milk tea,  this particular brand is quite good: a strong combination of good colour, definitely pleasing fragrance and taste thats firm but not too overpowering.This is a good option for someone used to tee leaves made by the likes of Wagh Bakri. This has slightly more liquor to it than the Wagh Bakhri and the fragrance spectrum is a bit wider.If youre the type who likes your Tata Agni and similar robust and bolder tea leaves then this may not be what youre looking for.Its price point is on the higher side and may be a factor for many. That said,  if you enjoy that one good cup a day,  its a worthy buy-in.My recommendation: certainly worth a try especially if you like a good,  developed flavour in your cuppa.');
