INSERT INTO review VALUES(2534, 187, 5, 'It is strong and tastes very good. After trying almost 10 different brands of tea, I have found the one I like. I have tried Taj Mahal, Red label, RCM and many different others.I like my tea strong and for that you dont have to add too much of this tea. It is not just too strong tea, it tastes good. Most in my family like it and this is the one we are going to use from now on along with Red Label for those who like Red Label more.And Amazon, from time to time, provides good discounts on products and makes them affordable for all. Btw, it sells for 355 next door mall when Amazon is selling it for 385. I know shipping costs, so it is ok.');
