INSERT INTO review VALUES(2720, 36, 3, 'Pros -Looks goodIndian brandConsThe software is poor.The band and app get updated everyday for bug fixes, but the update never completes.Sleep tracker doesnt work properly - no auto sensor, it depends on manual time feeding for sleep, plus sleep data changes of band firmware update causes sudden change in connection.Call notification does not work. It worked for a couple of calls, but then stopped on its own.Though the sedentary reminder was switched off, the band keeps vibrating every 15 minutes for reminding, even while walking or doing work. It stops only in night mode or when active workout is on.');
