INSERT INTO review VALUES(2723, 40, 1, 'I bought it for my mom as she was having problems related to her skin like hyperpigmentation. Being in her 50s she has a well managed diet plan and routine. The package delivered was suitable and fine look wise. But, after applying on face for a week, her forehead started to develop rashes accompanied by itchiness. She had to literally stop it and wait till it heals which took  more than two weeks. Personally I would not recommend this product to any of the ladies out there. Its just a waste of money and time. And ofcourse, I wont get a refund or payback. I am surely disappointed, dissatisfied, and annoyed.');
