INSERT INTO vanzare VALUES(2818, 8, 682, TO_DATE('2018-05-17 20:13:27', 'YYYY-MM-DD HH24:MI:SS'), 2595198);
INSERT INTO continutvanzare VALUES(2818, 219, 432533, 6);
INSERT INTO review VALUES(2818, 219, 5, 'Im a milk-tea addicted person. Although, I control it upto thrice day but sometimes it may exceed 5.Since I like milk-tea alot, I have tried many Dust-teas available in the market.Ive tried and tasted Wagh-bakri, brookebond, Taj, society, maharsthra chai, maa-beti Chai  you name it.I liked the society tea alot. This tea when boiled in the water gives a nice flavor and the color which no other teas can give.The packaging was nice. I ordered for a 1kg pack directly since I already knew about the taste.From the value for money standpoint, it is a little costlier (20-30 Rs per kg)  in comparison to its other teas of its class. But you will find it worth it. Just make sure you use a correct method to prepare to get the best out of it.Method in the sense, first boil it in water and then add milk.Directly adding into milk will also give you the good taste but the colour will fade away in that case.');
