INSERT INTO review VALUES(2834, 56, 4, 'I have been using this product for some time now. My Roommate had this and I had been planning to order for a while now. I just used to forget all the time, finally I have it now.Well from the last 2 months of use, heres my experience with the product:I use it every night and get a shower in the morning.Pros:1. The oil is non greasy, and pretty light.2. Has very good smell.no pungent or awkward fragrance3. My hair doesnt lump in together as with other hair oil products.4.Gives a pretty good shine and dark color5. Its very helpful for dandruff, hairfall/ hairloss. I dont have a very dense hair presence so my scalp was visible all the time, Now it looks pretty dense.Cons.1 .cant find anything at allI do recommend it for people having hairfall issues.');
