INSERT INTO continutvanzare VALUES(2898, 486, 466668, 4);
INSERT INTO review VALUES(2898, 486, 1, 'This is not the same product as advertised. I received a Steax Vitariche gloss serum instead of Streax pro Vitagloss as the product name suggests. Called CS to get the refund and since i had closed my bank account since the order was placed i wanted the refund to come through amazon pay. However Amazon rep Aniket and the supervisor Krishna were absolutely unhelpful and went against common sense to keep telling me that the refund will only be processed to the closed bank account and the bank will issue me a DD. When i called them out on their lack of common sense they kept repeating themselves. Finally decided to give away the product than to deal with Amazon for a refund. This shows how base Amazon’s customer service is and a good sign for all to avoid using Amazon if you value your money and time.');
INSERT INTO vanzare VALUES(2899, 8, 770, TO_DATE('2018-04-19 12:35:19', 'YYYY-MM-DD HH24:MI:SS'), 12898901);
INSERT INTO continutvanzare VALUES(2899, 123, 242119, 9);
INSERT INTO review VALUES(2899, 123, 1, 'To start off, the safe arrived with a Low Battery message, meaning that before I could do anything else, I had to go and get new batteries for this brand new item. Once you get things in order, the safe works well and serves its purpose, however, the manual provided is obsolete, and the instructions do not match up with this product. There are no solutions posted online either. If you want to program the safe, you have to figure it out on your own. The customer service personnel were not helpful either and they kept trying to force me to get a technician to come to my house at the cost of Rs. 500 just to program the device, which completely defeats the purpose of online shopping. Dont fall for it. This is rather ridiculous for such a big brand like Godrej.In case anyone else needs to re-program their home code, here is what I was able to do. I hope it works for you too:1.) The instructions indicate to press 68#, but it actually means 68(Lock). If the instructions indicate *, try pressing Clear2.) Every time I pressed 68#, I got an error message, so I had to go through all the steps listed below.3.) Before you can change personal code in home mode, you will need to Access The Programming (pg. 6). The code is 751019 which means that there are 6 different features that you can program. Go through all the steps and change the numbers as they suit you. When you get to the last digit, there are no instructions written in the book, so you will have to figure this out on your own. If the last digit is 1, change it to 0 or 9.4.) After going through the programming and changing the last number, you should be able to go back to change the personal code in home mode.5.) If you set your password and it doesnt lock, go back to the programming again, and change the last digit back to what it was originally.Good luck.');
